(function () {
    'use strict';
    var x = {};

    x.lastIp = "127.0.0.1";

    x.generateButton = (function () {
        var ip = x.lastIp;
        var dirtyMessage = document.getElementById("dirtyMessage");
        if (document.querySelector(".system").innerHTML.includes("Durch Dr√ºcken der Start-Taste und Nutzung"))
            return

        if (dirtyMessage != null) {
            if (ip == "127.0.0.1")
                return;

            if (document.querySelector(".system").innerHTML.includes(x.lastIp))
                return;

            if (dirtyMessage.innerHTML.includes(x.lastIp))
                return;

            dirtyMessage.remove();
        }

        console.log("Appending Button with IP-" + ip)
        var imgUrl = 'data:image/jpeg;base64,';

        var btnStyle = 'background-color: #4CAF50; border: none; color: white; padding: 15px 32px; text-align: center; text-decoration: none; display: inline-block; font-size: 16px;'

        var event = 'window.open(`https://extreme-ip-lookup.com/' + ip + '`, `_blank`, `width=850, height=300`);';
        var button = '<button style="' + btnStyle + '" onclick="' + event + '">Track User</button>';


        var elem = document.createElement("div");
        elem.innerHTML = '<div id="dirtyMessage" class="message out new"><div class="message-avatar"><img class="emojione" alt="üëÅ" title=":man:"' +
            'src="' + imgUrl + '"></div>' +
            '<div class="message-bubble">' +
            '<div class="message-text">' + button + '</div>' +
            '<div class="message-small-text  visible"></div>' +
            '<i class="message-report-flag" data-text="test"></i>' +
            '</div></div>';

        document.querySelector(".system").appendChild(elem);
        return;
    });

    x.clipboard = (function (ip) {
        const elem = document.createElement('textarea');
        elem.innerText = ip;
        elem.id = "toCopy";
        elem.style = "display: none;";
        document.body.appendChild(elem);

        var toCopy = document.getElementById("toCopy");
        toCopy.select();
        toCopy.setSelectionRange(0, 99999);

        navigator.clipboard.writeText(toCopy.value);

        toCopy.remove();
        return;
    })

    window.oRTCPeerConnection = window.oRTCPeerConnection || window.RTCPeerConnection;
    window.RTCPeerConnection = function (...args) {
        const pc = new window.oRTCPeerConnection(...args);
        pc.oaddIceCandidate = pc.addIceCandidate;
        pc.addIceCandidate = function (iceCandidate, ...rest) {
            const fields = iceCandidate.candidate.split(" ");
            const ip = fields[4];
            if (fields[7] === "srflx") {
                x.lastIp = ip;
                x.loop = setInterval(function () {
                    x.generateButton(x.lastIp);
                    clearInterval(x.loop)
                }, 1000);
                x.clipboard(ip);
            }
            return pc.oaddIceCandidate(iceCandidate, ...rest);
        };
        return pc;
    };
})();